class Individual{
    public: 
        list<std::pair<int, int>> listOfPoints;
        vector<vector<int> > pointsZones;
        float fitness = 0.0;
        float distance = 0.0;
           
        Individual(){
            this->createListOfPoints();
            // this->createListOfPointsCrossover();

        }
        void createListOfPoints(){
            float individualSum = 0.0; int initialX = 0; int initialY = 30; //initial = punto inicial del bichillo, mientras va avanzando entre segmentos.
            float y;float x; float b; float m; 
            int circuleRange = randomFunction(0,50);  //REVISAR cambiar por constante o alguna forma que no sea tan absoluta.
            this->pointsZones = {{265,146},{317,791},{754,772},{787,108},{936,107},{1076,748},{1534,700},{1801,126}};
            for(int counterZones = 0; counterZones < pointsZones.size(); counterZones++){
                
                int xPosition = pointsZones[counterZones][0];    //Revisar Cambiar por una constante X
                int yPosition = pointsZones[counterZones][1];

                std::pair<int, int> newPoint;
                newPoint.first = pointUbication(xPosition, circuleRange);
                newPoint.second = pointUbication(yPosition, circuleRange);

                xPosition = newPoint.first; yPosition = newPoint.second;

                m = slopeFuntion(initialX,initialY,xPosition,yPosition);
                b = initialY - (m * initialX); // y = (m*x) + b;

                int xRange = xPosition - initialX;
                float auxSum = isNiceLine(initialX,m,b,xRange);
                float distance = distanceBetweenPoints(initialX,initialY,xPosition,yPosition);

                individualSum += auxSum; individualSum += distance;
    
                listOfPoints.push_back(newPoint);
                initialX = xPosition; initialY = yPosition;
            // cout<<individualSum<<endl;
            //  xPosition = newPoint.first; yPosition = newPoint.second;
            this->distance = individualSum;
            }
        }

        

        float distanceBetweenPoints(int x1,int y1, int x2, int y2){
            float distance = sqrt((x2 - x1)*(x2 - x1 ) + (y2 - y1)*(y2 - y1));
            // float distance = sqrt((5 - 4)*(5 - 4 ) + (12 - 8)*(12 - 8));
            // cout<<"distancia: "<<distance<<endl;
            return distance;
        }

        int isNiceLine(int initialX,float m, float b, int xRange){
            GeneticRoadRunner geneticObject;
            for(int counterXRange = 0; counterXRange < xRange; counterXRange++){
                float x = initialX + counterXRange;
                float y = m*(x) + b;
                string yForSearch = castIntToString(y);
                string xForSearch = castIntToString(x);
                string searchInMap = xForSearch +","+ yForSearch;
                if(geneticObject.searchInHashTrack(searchInMap)){  //REVISAR No se como hacer para llamar la función de esa clase.
                    int sum = 20;   //REVISAR cambiar el valor por alguna constante, para que no sea tan absoluto. jeje 
                    return sum;
                }
            }
            return 0;

        }

        string castIntToString(int number){ //Función tomada de internet.
            stringstream ss;
            ss << number;
            string str = ss.str();
            return str;
        }

        float bInFuntion(int X1,int Y1,float m ){   //b = y1-(m*x1)
            float b = Y1-(m*X1);
            return b;
        }

        float slopeFuntion(int X1, int Y1,int X2, int Y2){    // Pendiente de la función.
            float m = (Y2-Y1)/(X2-X1);
            return m;
        }

        int randomFunction(int min, int max){
            int module = max - min;
            int value = min + rand() % module;
            return value;
        }

        int pointUbication(int value, int circuleRange){
            int minValue = value - circuleRange; int maxValue = value + circuleRange; 
            int newValue = randomFunction(minValue, maxValue);
            // cout<<newValue<<endl;
            return newValue;
        }
    
        friend class GeneticRoadRunner;
}; 

